        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 511 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 5029.68 s &lt;/li&gt;\n&lt;li&gt; transfer time: 10.89 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://10.32.2.21:34031 &lt;/li&gt;\n          &lt;li&gt; Workers: 128 &lt;/li&gt;\n          &lt;li&gt; Threads: 128 &lt;/li&gt;\n          &lt;li&gt; Memory: 1.86 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.09.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.09.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_jobqueue import SLURMCluster\nfrom distributed import Client\n\nfrom dask.distributed import performance_report, get_task_stream\n\n#import logging\n#logging.basicConfig(format='%(levelname)s:%(message)s', level=logging.DEBUG)\n\ncores = 32\nnodes = 4\n\ncluster = SLURMCluster(memory          = '{}g'.format(16*cores),\n                       processes       = cores,\n                       name            = 'testdask-${JOB_ID}',\n                       cores           = cores,\n                       queue           = 'photon',\n                       local_directory = '/tmp',\n                       death_timeout   = '100000000000s',\n                       walltime        = '01:00:00',\n                       header_skip     = ['-n 1'], \n                       env_extra       = ['JOB_ID=${SLURM_ARRAY_JOB_ID}_${SLURM_ARRAY_TASK_ID}'],\n                       job_extra       = ['--ntasks-per-node=1', '--array=0-{}'.format(nodes-1), '--exclusive']) \n\ncluster.scale(jobs=1)\nclient = Client(cluster)\n\nclient.get_versions(check=True)\n\n\n#import pdb; pdb.set_trace() \n#client.upload_file('../../root/root_rdfenv-ucx-2/lib/DistRDF/Backends/Dask/Backend.py')\n\nimport ROOT\nROOT.gROOT.SetBatch(True)\nRDataFrame = ROOT.RDF.Experimental.Distributed.Dask.RDataFrame\n\n\n\ndef dimuonSpectrum(df):\n\n    # Select events with exactly two muons\n    df_2mu = df.Filter(\"nMuon == 2\", \"Events with exactly two muons\")\n\n    # Select events with two muons of opposite charge\n    df_os = df_2mu.Filter(\"Muon_charge[0] != Muon_charge[1]\", \"Muons with opposite charge\")\n\n    # Compute invariant mass of the dimuon system\n    df_mass = df_os.Define(\"Dimuon_mass\", \"ROOT::VecOps::InvariantMass(Muon_pt, Muon_eta, Muon_phi, Muon_mass)\")\n\n    # Book histogram of dimuon mass spectrum\n    bins = 30000  # Number of bins in the histogram\n    low = 0.25  # Lower edge of the histogram\n    up = 300.0  # Upper edge of the histogram\n    hist = df_mass.Histo1D(ROOT.RDF.TH1DModel(\"\", \"\", bins, low, up), \"Dimuon_mass\")\n\n    hist.GetValue() # triggers the event loop\n\n\nif __name__ == '__main__':\n    \n    #filelist = [\"input_files/dimuon/f{}.root\".format(i) for i in range(1, 101)]\n    #df = RDataFrame(\"Events\", filelist, npartitions=256, daskclient=client) \n   \n    #import pdb; pdb.set_trace()\n   \n    for r in range(3):\n        filelist = [\"input_files/dimuon/f{}.root\".format(i+r) for i in range(1, 101)]\n        df = RDataFrame(\"Events\", filelist, npartitions=256, daskclient=client)\n        client.wait_for_workers(cores*nodes)\n        with performance_report(filename=\"dask-report100-present_{}.html\".format(r)):\n            dimuonSpectrum(df)\n    client.close()\n\n        &lt;/pre&gt;\n        "},"id":"5823","type":"Div"},{"attributes":{},"id":"5851","type":"BasicTickFormatter"},{"attributes":{"axis":{"id":"5470"},"coordinates":null,"group":null,"ticker":null,"visible":false},"id":"5473","type":"Grid"},{"attributes":{},"id":"5880","type":"Selection"},{"attributes":{"coordinates":null,"formatter":{"id":"5857"},"group":null,"major_label_policy":{"id":"5858"},"ticker":{"id":"5511"},"visible":false},"id":"5510","type":"LinearAxis"},{"attributes":{},"id":"5860","type"
